function App() {

  return (


    <div className="App">
{/* Creo le rotte */}

      <BrowserRouter>
      <Link to="/createpost">Crea un post</Link>    
      <Link to="/">Home</Link>   
        <Routes>
          <Route path="/" element={<Home/>} />
          <Route path="/createpost" element={<CreatePost/>} />

        </Routes>

      </BrowserRouter>


    </div>
  );
}

export default App;
